import React from 'react'
import {useState} from 'react';

const [name, setName] = useState("");

function Form() {
    return (
        <form>
            <label>Enter your name: </label>
            <input type="text" value={name} onChange={(e) => setName(e.target.value)}/>
        </form>
    )
}

export default Form;
